import React from "react";
import "./LoginPage.css";

const LoginPage = () => {
  const handleBackClick = () => {
    // Handle back button action (e.g., navigate to the previous page)
    console.log("Back button clicked");
  };

  return (
    <div className="login-page">
      {/* Back Button */}
      <button className="back-button" >
        <img src="arrow_back.png" alt="Back" />
      </button>

      {/* Orange Triangle */}
      <div className="orange-triangle">
        <img src="taco.png" alt="Orange Triangle" className="taco" />
      </div>

      {/* Pink Ellipse */}
      <div className="pink-ellipse">
        <img src="pinkelip.png" alt="Pink Ellipse" className="pink" />
      </div>

      {/* Login Form */}
      <div className="login-container">
        <form>
          <label>Email</label>
          <input type="email" placeholder="Enter your email" />

          <label>Password</label>
          <input type="password" placeholder="********" />

          <button type="submit" className="btn login-btn">Log In</button>

          <div className="or">OR</div>

          <button type="button" className="btn google-btn">
            <img src="google.png" alt="Google Icon" />
            Sign In with Google
          </button>
        </form>
        <div className="register">
          Donâ€™t have an account? <a href="/register">Register now</a>
        </div>
      </div>

      {/* Bottom Circle */}
      <div className="bottom-circle">
        <img src="bottomellip.png" alt="Bottom Circle" className="bottom" />
      </div>
    </div>
  );
};

export default LoginPage;
